import React from 'react';
import Logo from '../components/logo/Logo';
import '../components/logo/_logo.scss';
import Navigation from '../components/Navigation/Navigation.js';
import "../pages/Home.scss"

const Home = () => {
    return (
        <div>
            <Navigation />
            <Logo />

        <div className="forum">
            <h1>Publications</h1>
        </div>
            
        </div>
    );
};

export default Home;
